import React from "react";
import { Card, Avatar } from "antd";

const UserProfile = (props) => {
  return (
    <Card
      actions={[
        <div key="twit">
          짹짹
          <br />0
        </div>,
        <div key="follwings">
          팔로잉
          <br />0
        </div>,
        <div key="followers">
          팔로워
          <br />0
        </div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>ZC</Avatar>} title="devZucca"></Card.Meta>
    </Card>
  );
};

export default UserProfile;
